import './App.css';
import logo from './wre-logo.png';

function App() {

  const img = require("./wre-logo.png").default;

  console.log(logo);
  console.log(img);

  return (
    <div>
      <img src={ img } alt="logo" />
    </div>
  );
}

export default App;
